import styled from "styled-components/native";

export const ContainerLogin = styled.SafeAreaView`
    flex: 1;
    align-items: center;
    justify-content: center;
    background-color: #161616;
`;

export const Logo = styled.View`
    padding-bottom: 20px;
`;

export const InputForm = styled.TextInput`
    background-color: #fff;
    width: 90%;
    margin-bottom: 15px;
    color: #222;
    font-size: 18px;
    border-radius: 6px;
    padding: 10px;
`;

export const BtnSubmitForm = styled.TouchableOpacity`
    background-color: #ebb105;
    width: 90%;
    height: 45px;
    align-items: center;
    justify-content: center;
    border-radius: 6px;
`;

export const TxtSubmitForm = styled.Text`
    color: #fff;
    font-size: 22px;
`;

export const LinkNewUser = styled.Text`
    color: #fff;
    margin-top: 10px;
    font-size: 18px;
`;

export const ImageLogo = styled.Image`
    width: 120px;
    height: 120px;
`;

export const LoadingArea = styled.View`
    position: absolute;
    left: 0;
    top: 0;
    right: 0;
    bottom: 0;
    background-color: rgba(0,0,0,0.6);
    align-items: center;
    justify-content: center;
`;

export const Container = styled.SafeAreaView`
    flex: 1;
    padding: 8px;
    flex-direction: column;
    justify-content: flex-start;
    background-color: #fff;
    align-self: stretch;
`;

export const TitleList = styled.Text`
    color: #111;
    font-size: 22px;
    padding: 10px 0;
`;

export const List = styled.View`
    width: 95%;
`;

export const RowData = styled.View`
    background-color: #f5f5f5;
    padding: 10px;
    margin: 5px 0;
    border-radius: 6px;
    flex-direction: row;
    justify-content: flex-start;
`;

export const InfoData = styled.Text`
    color: #111;
    flex: 1;
    flex-direction: column;
`;

export const ValueData = styled.Text`
    font-size: 16px;
    flex: 0;
`;

export const BtnView = styled.Text`
    justify-content: flex-end;
`;

export const TitleViewContent = styled.Text`
    padding-top: 15px;
    color: #111;
    font-weight: bold;
    font-size: 18px;
`;

export const ViewContent = styled.Text`
    padding-bottom: 15px;
    color: #111;
    font-size: 18px;
    border-bottom-color: #c0c0c0;
    border-bottom-width: 1px;
`;

export const BtnActionEdit = styled.TouchableOpacity`
    margin-top: 15px;
    background-color: #ebb105;
    width: 100%;
    height: 45px;
    align-items: center;
    justify-content: center;
    border-radius: 6px;
`;

export const BtnActionDelete = styled.TouchableOpacity`
    margin-top: 15px;
    background-color: #dc3545;
    width: 100%;
    height: 45px;
    align-items: center;
    justify-content: center;
    border-radius: 6px;
`;

export const TxtBtnAction = styled.Text`
    color: #fff;
    font-size: 19px;
`;

export const TitleIcon = styled.TouchableOpacity`
    margin-right: 10px;
    padding: 15px;
`;

export const LabelFormDash = styled.Text`
    color: #111;
    font-size: 18px;
`;

export const InputFormDash = styled.TextInput`
    background-color: #fff;
    width: 100%;
    margin-bottom: 15px;
    padding: 10px;
    color: #222;
    font-size: 18px;
    border-radius: 6px;
    border-color: #ebb105;
    border-width: 1px;
`;

export const BtnSubmitFormDash = styled.TouchableOpacity`
    background-color: #ebb105;
    width: 100%;
    height: 45px;
    align-items: center;
    justify-content: center;
    border-radius: 6px;
`;

export const TxtSubmitFormDash = styled.Text`
    color: #fff;
    font-size: 19px;
`;

export const TitleRequired = styled.Text`
    padding-bottom: 5px;
    color: #111;
    font-size: 12px;
`;



export const Exemplo = styled.Text`

`;
